import React from 'react'

export default function User({ firstname, lastname, age }) {
    let specialMessage;

    if (firstname === 'myFirstName') {
        specialMessage = <p>NKJNJKNKJ</p>;
    }

    return (
        <div>
            {specialMessage}
            <p>Name: {firstname} {lastname}</p>
            {
                age >= 30
                    ? <p>Age: {age}. Dear {firstname} {lastname} is old enough</p>
                    : <p>Age is below 30. {firstname} is {age} years old</p>
            }
            <br />
        </div>
    );
}
